import React, { useState } from 'react';
import { questions, quizResultDescriptions } from './data';
import './App.css';

const QuizPage = () => {
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  // answers ‰øùÂ≠òÊØèÈ¢òÈÄâ‰∏≠ÁöÑÈÄâÈ°πÔºàÊï¥‰∏™ÂØπË±°ÔºåÂåÖÂê´ÈÄâÈ°πÊñáÂ≠óÂíåÂàÜÊï∞Êò†Â∞ÑÔºâ
  const [answers, setAnswers] = useState({});
  const [result, setResult] = useState(null);

  const handleChange = (questionId, selectedOption) => {
    setAnswers({
      ...answers,
      [questionId]: selectedOption,
    });
  };

  const goToNextQuestion = () => {
    if (currentQuestionIndex < questions.length - 1) {
      setCurrentQuestionIndex(currentQuestionIndex + 1);
    }
  };

  const goToPreviousQuestion = () => {
    if (currentQuestionIndex > 0) {
      setCurrentQuestionIndex(currentQuestionIndex - 1);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // ÂàùÂßãÂåñÊâÄÊúâÂä®Áâ©ÁöÑÂàÜÊï∞
    const scores = {
      Owl: 0,
      Squirrel: 0,
      Fox: 0,
      Penguin: 0,
      Raccoon: 0,
      Cheetah: 0,
      Dog: 0,
      Beaver: 0,
    };

    // Á¥ØÂä†ÊØèÈ¢òÈÄâÈ°πÂØπÂ∫îÁöÑÂàÜÊï∞ÔºàÊØè‰∏™ÈÄâÈ°πÁöÑ scores Â±ûÊÄß‰∏∫‰∏Ä‰∏™ÂØπË±°Ôºâ
    Object.keys(answers).forEach((qId) => {
      const optionScores = answers[qId].scores;
      for (let animal in optionScores) {
        scores[animal] = (scores[animal] || 0) + optionScores[animal];
      }
    });

    // ÊâæÂá∫ÊúÄÈ´òÂàÜ
    let highestScore = -1;
    for (let animal in scores) {
      if (scores[animal] > highestScore) {
        highestScore = scores[animal];
      }
    }

    // ÊâæÂá∫ÂæóÂàÜÊúÄÈ´òÁöÑÊâÄÊúâÂä®Áâ©
    const topAnimals = Object.keys(scores).filter(
      (animal) => scores[animal] === highestScore
    );

    let resultKey = '';
    if (topAnimals.length === 1) {
      resultKey = topAnimals[0];
    } else if (topAnimals.length > 1) {
      // Ê∑∑ÂêàÊÄßÊ†ºÔºöÂ§ö‰∏™Âä®Áâ©‰ª• ' x ' ËøûÊé•
      resultKey = topAnimals.join(' x ');
    } else {
      // ÈªòËÆ§ÊÉÖÂÜµ
      resultKey = 'Raccoon';
    }

    // Ê†πÊçÆ resultKey ÊâæÂà∞ÂØπÂ∫îÊèèËø∞Ôºà‰Ω†ÂèØ‰ª•Âú® quizResultDescriptions ‰∏≠È¢ÑËÆæÊ∑∑ÂêàÂûãÊèèËø∞ÊàñÁõ¥Êé•ÊãºÊé•Ôºâ
    const description = quizResultDescriptions[resultKey] || {
      title: resultKey,
      analysis: `‰Ω†ÁöÑË¥¢Âä°ÊÄßÊ†ºÂ±ïÁé∞Âá∫Ê∑∑ÂêàÁâπË¥®Ôºö${resultKey}`,
      advice: '‰øùÊåÅÁúüÂÆûÔºåÂèëÊå•ÂêÑÂä®Áâ©‰ºòÁÇπÔºÅ',
    };

    setResult(description);
  };

  const currentQuestion = questions[currentQuestionIndex];

  return (
    <div className="quiz-page">
      <div className="quiz-header">
        <h2>
          üî• Ultimate Financial Personality Quiz ‚Äì The Internet Animal Edition{' '}
          <span role="img" aria-label="animals">
            üêøÔ∏èüêßü¶âü¶äü¶ùüêÜüê∂ü¶´
          </span>
        </h2>
        <p>
          Answer a few fun questions to expose your financial habits in the most
          ËÖπÈªë, brutally honest way possible.
        </p>
      </div>
      <form onSubmit={handleSubmit}>
        <div className="question-card">
          <h3>{`Question ${currentQuestion.id} of ${questions.length}`}</h3>
          <p>{currentQuestion.question}</p>
          <div className="options-container">
            {currentQuestion.options.map((option, index) => (
              <label key={index} className="option-label">
                <input
                  type="radio"
                  name={`question-${currentQuestion.id}`}
                  value={option.option}
                  checked={
                    answers[currentQuestion.id] &&
                    answers[currentQuestion.id].option === option.option
                  }
                  onChange={() =>
                    handleChange(currentQuestion.id, option)
                  }
                  required
                />
                <span className="option-text">{option.option}</span>
              </label>
            ))}
          </div>
        </div>
        <div className="nav-buttons">
          <button
            type="button"
            className="nav-btn"
            onClick={goToPreviousQuestion}
            disabled={currentQuestionIndex === 0}
          >
            ‚Üê Previous
          </button>
          {currentQuestionIndex < questions.length - 1 ? (
            <button type="button" className="nav-btn" onClick={goToNextQuestion}>
              Next ‚Üí
            </button>
          ) : (
            <button type="submit" className="submit-btn">
              Submit Quiz
            </button>
          )}
        </div>
      </form>
      {result && (
        <div className="result-container">
          <h3>{result.title}</h3>
          <p>
            <strong>Result Analysis:</strong> {result.analysis}
          </p>
          <p>
            <strong>Advice:</strong> {result.advice}
          </p>
        </div>
      )}
    </div>
  );
};

export default QuizPage;
